 //border-color: hsl(216, 94%, 73%);\n}\n.sds-accordion__title-text {\n  display: inline-block;\n  font-weight: font-weight('normal');\n  div:last-child{\n    font-weight: font-weight('semibold');\n  }\n}\n.sds-accordion__item {\n  display: block;\n  overflow: hidden;\n  padding: 6px;\n  background-color: #fff;\n  transition: all 0.2s ease-in;\n}\n\n.sds-accordion__item--expanded {\n  background-color: #eff6fb;\n  overflow: visible;\n  box-shadow: inset 0 1px 7px 0 rgba(30, 75, 198, 0.16);\n}\n.sds-accordion__trigger:focus .sds-accordion__icon,\n.sds-accordion__trigger:hover .sds-accordion__icon {\n  background-color: white;\n}\n\n.sds-accordion__icon {\n  transition: transform 0.2s ease-in;\n  width: 24px;\n  height: 24px;\n  transform: rotate(180deg);\n  position: absolute;\n  right: 10px;\n  border-radius: 50%;\n  background-color: #e2e2e2;\n}\n\n.sds-accordion__icon::before {\n  content: '';\n  display: block;\n  width: 11px;\n  height: 0;\n  border-bottom: solid 1px #0a3466;\n  position: absolute;\n  left: 6px;\n  bottom: 11px;\n  transform: rotate(90deg);\n  transition: width 0.2s ease-in;\n}\n\n.sds-accordion__icon::after {\n  content: '';\n  display: block;\n  width: 11px;\n  height: 0;\n  border-bottom: solid 1px #0a3466;\n  position: absolute;\n  left: 6px;\n  bottom: 11px;\n  transition: width 0.2s ease-in;\n}\n\n.sds-accordion__trigger[aria-expanded='true'] .sds-accordion__icon {\n  transform: rotate(0deg);\n  background-color: white;\n}\n\n.sds-accordion__trigger[aria-expanded='true'] .sds-accordion__icon::after {\n  bottom: 11px;\n}\n\n.sds-accordion__trigger[aria-expanded='true'] .sds-accordion__icon::before {\n  width: 0;\n  transform: rotate(90deg);\n}\n\n.sds-accordion__trigger[aria-expanded='true'] {\n  color: #0a3466;\n  background-color: #eff6fb;\n}\n.sds-accordion__panel {\n  padding: 0;\n}\n\n.sds-accordion__panel-body {\n  padding: 8px 5px 8px 0px;\n\n  .usa-form-group {\n    padding-left: 11px;\n  }\n}\n\n/* Accordion -- Basic */\n.sds-accordion.sds-accordion--basic {\n  border-color: transparent;\n  padding-bottom: 0;\n}\n\n.sds-accordion.sds-accordion--basic.focus {\n  //border-color: hsl(216, 94%, 73%);\n}\n\n.sds-accordion.sds-accordion--basic .sds-accordion__item {\n  border: none;\n  background-color: transparent;\n  padding: 0;\n  margin-bottom: 0;\n}\n\n.sds-accordion.sds-accordion--basic .sds-accordion__item--expanded {\n  background-color: transparent;\n  box-shadow: none;\n}\n\n.sds-accordion.sds-accordion--basic .sds-accordion__trigger {\n  background-color: transparent;\n  font-size: 16px;\n}\n\n.sds-accordion.sds-accordion--basic\n.sds-accordion__trigger[aria-expanded='true'] {\n  background-color: transparent;\n}\n\n.sds-accordion.sds-accordion--basic .sds-accordion__icon {\n  border: solid #0a3466;\n  border-width: 0 1px 1px 0;\n  height: 0.5rem;\n  pointer-events: none;\n  position: absolute;\n  right: 15px;\n  top: 50%;\n  transform: translateY(-60%) rotate(45deg);\n  width: 0.5rem;\n  border-radius: 0;\n  background-color: transparent;\n}\n\n.sds-accordion.sds-accordion--basic\n.sds-accordion__trigger[aria-expanded='true']\n.sds-accordion__icon {\n  transform: rotate(-135deg);\n}\n\n.sds-accordion.sds-accordion--basic .sds-accordion__icon::before,\n.sds-accordion.sds-accordion--basic .sds-accordion__icon::after {\n  content: none;\n}\n\n.sds-accordion.sds-accordion--basic\n.sds-accordion__panel\n.sds-accordion__panel-body {\n  margin: 0 5px;\n  padding: 1px 8px 10px;\n  background-color: white;\n  box-shadow: inset 0 1px 3px 0 rgba(0, 0, 0, 0.5);\n}\n\n.usa-sidenav__sublist {\n  li {\n    @include u-margin-bottom(0);\n  }\n}\n\n/* stylelint-enable */",".sds-tree-table--scrollable {\n    overflow: scroll;\n  \n    .sds-tree-table {\n      width: 59.25rem;\n    }\n  }\n  \n  table.sds-tree-table {\n    border-collapse:separate; \n    border-spacing: 0 5px;\n  \n    thead {\n      th {\n        border: none;\n        @include u-padding(2);\n        @include u-bg('accent-cool-lighter');\n      }\n      \n      @include u-border('accent-cool-light');  \n    }\n    \n    tbody {\n    \n      td {\n        border-style: none;\n        position: relative;\n        .horizontal-border {\n          border-top: 3px dashed;\n          height: 1px;\n          position: absolute;\n          width: 100%;\n          top: 50%;\n          color: color('ink');\n        }\n    \n        .vertical-border {\n          border-left: 3px dashed;\n          width: 1px;\n          height: 100%;\n          position: absolute;\n          bottom: 40px;\n          color: color('ink');\n        }\n      }\n      \n      tr:not(.text-center) {\n    \n        td:first-child {\n          position: relative;\n          .usa-button {\n            cursor: pointer;\n            top: 0.25rem;\n            color: color('accent-cool');\n            svg {\n              background-color: color('ink');\n              border-radius: 50%;\n            }\n          }\n  \n          .usa-button:hover {\n            filter: drop-shadow(0 0 12px rgba(0, 0, 0, 0.1));\n          }\n        }\n    \n        td:nth-child(2) {\n          border-left: 1px solid color('base-light');\n        }\n      \n        td:not(:first-child) {\n          border-top: 1px solid color('base-light');\n          border-bottom: 1px solid color('base-light');\n        }\n      \n        td:last-child {\n          border-right: 1px solid color('base-light');\n        }\n      }\n    \n      tr[aria-expanded] {\n        td {\n          background-color: color('base-lightest');\n        }\n    \n        td:first-child {\n          background-color: unset;\n        }\n      }\n    \n  \n      tr[aria-level=\"1\"] {\n        .vertical-border {\n          margin-left: 1rem;\n          margin-top: 1rem;\n        }\n  \n        .horizontal-border {\n          margin-left: 2rem;\n        }\n      }\n    }\n    \n    \n    .sds-tree-table__row--selected:not(.text-center) {\n      td:nth-child(2) {\n        @include u-border-left('secondary');\n      }\n    \n      td:not(:first-child) {\n        @include u-border-top('secondary');\n        @include u-border-bottom('secondary');\n      }\n    \n      td:last-child {\n        @include u-border-right('secondary');\n      }\n    }\n  \n    .sds-tree-table__row--highlight-border > td {\n      .vertical-border-top {\n        border-color: color('secondary');\n      }\n  \n      .vertical-border {\n        border-color: color('secondary');\n      }\n  \n      .horizontal-border {\n        border-color: color('secondary');\n      }\n    }\n  \n  \n   // CSS for up to 10 nested children\n    @for $i from 1 through 10 {\n      tr[aria-level=\"#{$i}\"] {\n        td:nth-child(2), .usa-button {\n          position: relative;\n          left: #{($i * 1.5) - 1.5}rem;\n        }\n  \n        td:nth-child(2) {\n          padding-right: #{($i * 1.5) - 1.5}rem;\n        }\n  \n        .vertical-border, .horizontal-border {\n          margin-left: #{($i * 1.5) - 2}rem;\n        }\n      }\n  \n    }\n  }"],sourceRoot:""}]),module.exports=___CSS_LOADER_EXPORT___},"./sam-styles/packages/branding/colors/templates/state-color.html":module=>{module.exports='<div class="styleguide-content"> <h2 id="uswds-state-color-tokens">State color tokens</h2> <p> The state color palette is divided into five high-level role-based color families: <code class="highlighter-rouge">info</code>, <code class="highlighter-rouge">error</code>, <code class="highlighter-rouge">warning</code>, <code class="highlighter-rouge">success</code>, and <code class="highlighter-rouge">disabled</code>. </p> <p> For more information: <a class="usa-link" href="https://v2.designsystem.digital.gov/design-tokens/color/system-tokens/"> USWDS system color tokens </a> </p> <div class="site-table-wrapper"> <table class="sds-table"> <thead class="sds-table__head"> <tr> <th scope="col">Color</th> <th scope="col">Token</th> <th scope="col">Default</th> <th scope="col">Settings variable</th> <th scope="col">Val